Ne rasprostranyaetsya na vozdushnye suda, osushhestvlyayushhie polety:
- na vysote ne nizhe 600 m s/na aerodrom Pushkin po ustanovlennym marshrutam vhoda/vyhoda na vozdushnye trassy, shemam zahoda na posadku, a takzhe po traektoriyam, zadavaemym organom OVD metodom vektoreniya;
- na vysote ne nizhe 900 m s/na aerodrom Pulkovo po ustanovlennym marshrutam vhoda/vyhoda na vozdushnye trassy (standartnym marshrutam vyleta, prileta, shemam zahoda na posadku), a takzhe po traektoriyam, zadavaemym organom OVD metodom vektoreniya
